column8:
レモン果汁にはちみつを加えた、手作りしたようなやさしい味わいを楽しめる液体希釈タイプのホット飲料です。お湯で割るだけで手軽に作れ、ほっと温まるおいしさを楽しみながら、ビタミンＣも補給できます。
<br>●名称：清涼飲料水<br>●内容量：450ml×1ケース（全12本）<br>●原材料名：砂糖類（果糖ぶどう糖液糖、砂糖）、レモン果汁、はちみつ、香料、酸味料、ビタミンＣ、ベニバナ黄色素<br>●栄養成分：(100mlあたり)   エネルギー50kcal,たんぱく質0g,脂質0g,炭水化物13ｇ,ナトリウム31mg,ビタミンC16mg<br>●賞味期限：（メーカー製造日より）270日<br>●保存方法：高温・直射日光をさけて保存してください。<br>●販売者：アサヒ飲料株式会社<table width="710"> <tbody> <tr> <td>

